import React from "react";
import {
  Accordion,
  AccordionItem,
  AccordionItemHeading,
  AccordionItemButton,
  AccordionItemPanel,
} from "react-accessible-accordion";

import 'react-accessible-accordion/dist/fancy-example.css';
import { Button } from "reactstrap";

export const Projects = () => {
  return( 
      <>
       <div className="projectsDiv">
       <h2 id="contactTitle">Some of my recent projects</h2>
       <Accordion className="accordionDiv" allowZeroExpanded>
            <AccordionItem className="projectsDiv">
                <AccordionItemHeading>
                    <AccordionItemButton style={{backgroundColor:"rgba(255,255,255,0)",fontSize:"1.4rem",fontWeight:"500"}}>
                        Online Face Recognition Attendance System (BE Group Project)
                    </AccordionItemButton>
                </AccordionItemHeading>
                <AccordionItemPanel>
                    <p>
                        Exercitation in fugiat est ut ad ea cupidatat ut in
                        cupidatat occaecat ut occaecat consequat est minim minim
                        esse tempor laborum consequat esse adipisicing eu
                        reprehenderit enim.
                        <br />

                        <Button className="btn btn-lg resumeBtn" style={{marginLeft:"0rem",padding:"auto"}}>Link</Button>
                    </p>
                </AccordionItemPanel>
            </AccordionItem>
        </Accordion>
  </div>
  </>
  );
};
